import React from 'react';
import './styles/Navigationbar.css';

const searchbar = () => (
    <form className="searchbar">
        <label className="search-label">Suche: </label>
        <input className="input" label="Suche" type="text" placeholder="Was suchen Sie?"></input>
    </form>
);

export default searchbar;
